import React from 'react';
import imgPrg from '../assets/progXpassRate.JPG'
import imgcake from '../assets/Cake.JPG'
import './Progress.css';

const Progress=()=> {
    return(
        <div className="body">
            <img className="img" src={imgPrg}/>
            <img className="img" src={imgcake}/>
        </div>
    )
}

export default Progress;
